(2, 1, '2019-01-04 10:59:04', '2019-01-04 09:59:04', '<!-- wp:paragraph -->\n<p>Ceci est une page dexemple. Cest diffrent dun article de blog parce quelle restera au mme endroit et apparatra dans la navigation de votre site (dans la plupart des thmes). La plupart des gens commencent par une page  propos qui les prsente aux visiteurs du site. Cela pourrait ressembler  quelque chose comme cela:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Bonjour! Je suis un mcanicien qui aspire  devenir acteur, et voici mon site. Jhabite  Bordeaux, jai un super chien baptis Russell, et jaime la vodka-ananas (ainsi qutre surpris par la pluie soudaine lors de longues balades sur la plage au coucher du soleil).</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>... ou quelque chose comme cela:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>La socit 123 Machin Truc a t cre en 1971, et na cess de proposer au public des machins-trucs de qualit depuis lors. Situe  Saint-Remy-en-Bouzemont-Saint-Genest-et-Isson, 123 Machin Truc emploie 2 000 personnes, et fabrique toutes sortes de bidules super pour la communaut bouzemontoise.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>En tant que nouvelle utilisateur ou utilisatrice de WordPress, vous devriez vous rendre sur <a href=\"http://localhost:8888/FooDog2-WP/wp-admin/\">votre tableau de bord</a> pour supprimer cette page et crer de nouvelles pages pour votre contenu. Amusez-vous bien!</p>\n<!-- /wp:paragraph -->', 'Page dexemple', '', 'publish', 'closed', 'open', '', 'page-d-exemple', '', '', '2019-01-04 10:59:04', '2019-01-04 09:59:04', '', 0, 'http://localhost:8888/FooDog2-WP/?page_id=2', 0, 'page', '', 0),
(3, 1, '2019-01-04 10:59:04', '2019-01-04 09:59:04', '<!-- wp:heading --><h2>Qui sommes-nous?</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Ladresse de notre site Web est: http://localhost:8888/FooDog2-WP.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Utilisation des donnes personnelles collectes</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Commentaires</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Quand vous laissez un commentaire sur notre site web, les donnes inscrites dans le formulaire de commentaire, mais aussi votre adresse IP et lagent utilisateur de votre navigateur sont collects pour nous aider  la dtection des commentaires indsirables.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Une chane anonymise cre  partir de votre adresse de messagerie (galement appele hash) peut tre envoye au service Gravatar pour vrifier si vous utilisez ce dernier. Les clauses de confidentialit du service Gravatar sont disponibles ici: https://automattic.com/privacy/. Aprs validation de votre commentaire, votre photo de profil sera visible publiquement  cot de votre commentaire.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Mdias</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Si vous tes un utilisateur ou une utilisatrice enregistre et que vous tlversez des images sur le site web, nous vous conseillons dviter de tlverser des images contenant des donnes EXIF de coordonnes GPS. Les visiteurs de votre site web peuvent tlcharger et extraire des donnes de localisation depuis ces images.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Formulaires de contact</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Cookies</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Si vous dposez un commentaire sur notre site, il vous sera propos denregistrer votre nom, adresse de messagerie et site web dans des cookies. Cest uniquement pour votre confort afin de ne pas avoir  saisir ces informations si vous dposez un autre commentaire plus tard. Ces cookies expirent au bout dun an.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Si vous avez un compte et que vous vous connectez sur ce site, un cookie temporaire sera cr afin de dterminer si votre navigateur accepte les cookies. Il ne contient pas de donnes personnelles et sera supprim automatiquement  la fermeture de votre navigateur.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Lorsque vous vous connecterez, nous mettrons en place un certain nombre de cookies pour enregistrer vos informations de connexion et vos prfrences dcran. La dure de vie dun cookie de connexion est de deux jours, celle dun cookie doption dcran est dun an. Si vous cochez Se souvenir de moi, votre cookie de connexion sera conserv pendant deux semaines. Si vous vous dconnectez de votre compte, le cookie de connexion sera effac.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>En modifiant ou en publiant une publication, un cookie supplmentaire sera enregistr dans votre navigateur. Ce cookie ne comprend aucune donne personnelle. Il indique simplement lID de la publication que vous venez de modifier. Il expire au bout dun jour.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Contenu embarqu depuis dautres sites</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Les articles de ce site peuvent inclure des contenus intgrs (par exemple des vidos, images, articles). Le contenu intgr depuis dautres sites se comporte de la mme manire que si le visiteur se rendait sur cet autre site.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Ces sites web pourraient collecter des donnes sur vous, utiliser des cookies, embarquer des outils de suivis tiers, suivre vos interactions avec ces contenus embarqus si vous disposez dun compte connect sur leur site web.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Statistiques et mesures daudience</h3><!-- /wp:heading --><!-- wp:heading --><h2>Utilisation et transmission de vos donnes personnelles</h2><!-- /wp:heading --><!-- wp:heading --><h2>Dures de stockage de vos donnes</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Si vous laissez un commentaire, le commentaire et ses mtadonnes sont conservs indfiniment. Cela permet de reconnatre et approuver automatiquement les commentaires suivants au lieu de les laisser dans la file de modration.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Pour les utilisateurs et utilisatrices qui senregistrent sur notre site (si cela est possible), nous stockons galement les donnes personnelles indiques dans leur profil. Tous les utilisateurs et utilisatrices peuvent voir, modifier ou supprimer leurs informations personnelles  tout moment ( lexception de leur nom dutilisateurice). Les gestionnaires du site peuvent aussi voir et modifier ces informations.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Les droits que vous avez sur vos donnes</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Si vous avez un compte ou si vous avez laiss des commentaires sur le site, vous pouvez demander  recevoir un fichier contenant toutes les donnes personnelles que nous possdons  votre sujet, incluant celles que vous nous avez fournies. Vous pouvez galement demander la suppression des donnes personnelles vous concernant. Cela ne prend pas en compte les donnes stockes  des fins administratives, lgales ou pour des raisons de scurit.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Transmission de vos donnes personnelles</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Les commentaires des visiteurs peuvent tre vrifis  laide dun service automatis de dtection des commentaires indsirables.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Informations de contact</h2><!-- /wp:heading --><!-- wp:heading --><h2>Informations supplmentaires</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Comment nous protgeons vos donnes</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Procdures mises en uvre en cas de fuite de donnes</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Les services tiers qui nous transmettent des donnes</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Oprations de marketing automatis et/ou de profilage ralises  laide des donnes personnelles</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Affichage des informations lies aux secteurs soumis  des rgulations spcifiques</h3><!-- /wp:heading -->', 'Politique de confidentialit', '', 'draft', 'closed', 'open', '', 'politique-de-confidentialite', '', '', '2019-01-04 10:59:04', '2019-01-04 09:59:04', '', 0, 'http://localhost:8888/FooDog2-WP/?page_id=3', 0, 'page', '', 0),
